import { FcCheckmark } from "react-icons/fc";
import styled from "styled-components";

const TaskList = (props) => {
  const { tasks } = props;

  return (
    <ul>
      {tasks.map((task) => {
        return (
          <Li key={task.id}>
            <Span>{task.title}</Span>
            <Click>
              <FcCheckmark />
            </Click>
          </Li>
        );
      })}
    </ul>
  );
};

const Li = styled.li`
  margin-bottom: 0.8em;
`;
const Span = styled.span`
  margin: 0 1em 0 0;
`;
const Click = styled.span`
  cursor: pointer;
`;
export default TaskList;
